import React, { useState } from 'react';
import { Form, Button, Container, Row, Col, Card, Alert } from 'react-bootstrap';
import './UstawieniaKonta.css';
import guitarUser from "../assets/guitarist.jpg";

const UstawieniaKonta = () => {
  const [user, setUser] = useState({
    Nazwa: 'Krzysztof Urbański',
    email: 'krzysztofurban@gmail.com',
    numer: '606-942-106',
    opis: 'Gitarzysta z wieloletnim doświadczeniem...',
    // miasto: 'Wrocław',
    zdjecie: guitarUser
  });

  const [showAlert, setShowAlert] = useState(false);

  const handleSaveChanges = () => {
    setShowAlert(true);
    setTimeout(() => {
      setShowAlert(false);
    }, 3000);
  };

  const handleFileChange = (e) => {
    setUser({ ...user, zdjecie: URL.createObjectURL(e.target.files[0]) });
  };

  return (
    <Container fluid className='pageBackground'>
      <Row className="mt-5">
        <Col md={{ span: 6, offset: 3 }}>
          <Card>
            <Card.Body>
              <Card.Title >Twoje konto</Card.Title>
              <Form>
                <Form.Group>
                  <Form.Label>Imię i Nazwisko</Form.Label>
                  <Form.Control
                    type="text"
                    name="Nazwa"
                    value={user.Nazwa}
                    onChange={(e) => setUser({ ...user, Nazwa: e.target.value })}
                  />
                </Form.Group>
                <Form.Group>
                  <Form.Label>E-mail</Form.Label>
                  <Form.Control
                    type="email"
                    name="email"
                    value={user.email}
                    onChange={(e) => setUser({ ...user, email: e.target.value })}
                  />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Numer kontaktowy</Form.Label>
                  <Form.Control
                    type="text"
                    name="numer"
                    value={user.numer}
                    onChange={(e) => setUser({ ...user, numer: e.target.value })}
                  />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Miasto</Form.Label>
                  <Form.Control
                    as="select"
                    name="miasto"
                    value={user.miasto}
                    onChange={(e) => setUser({ ...user, miasto: e.target.value })}
                    placeholder='-'
                  >                  
                    <option value="Warszawa">Warszawa</option>
                    <option value="Kraków">Kraków</option>
                    <option value="Gdańsk">Gdańsk</option>
                    <option value="Wrocław">Wrocław</option>
                    <option value="Poznań">Poznań</option>                    
                    <option value="Poznań">Rzeszów</option>                    
                  </Form.Control>
                </Form.Group>
                <Form.Group>
                  <Form.Label>Opis</Form.Label>
                  <Form.Control
                    as="textarea"
                    name="opis"
                    value={user.opis}
                    onChange={(e) => setUser({ ...user, opis: e.target.value })}
                  />
                </Form.Group>                
                <Form.Group>
                  <Form.Label>Zdjęcie</Form.Label>
                  <Form.Control
                    type="file"
                    accept="image/*"
                    onChange={handleFileChange}
                  />                  
                  {user.zdjecie && <img id="userImage" src={user.zdjecie} alt="Podgląd zdjęcia" />}
                </Form.Group>
                <Button variant="primary" className="w-100" id="saveBtn" onClick={handleSaveChanges}>Zapisz zmiany</Button>
              </Form>
            </Card.Body>
          </Card>
        </Col>
      </Row>
      {showAlert && (
        <Row className="mt-3">
          <Col md={{ span: 6, offset: 3 }}>
            <Alert variant="success" onClose={() => setShowAlert(false)} dismissible>
              Zmiany zostały zapisane!
            </Alert>
          </Col>
        </Row>
      )}
    </Container>
  );
}

export default UstawieniaKonta;
